"use strict";var _calculator=require("./_calculator.js");$(document).ready(function(){var c=new _calculator;$("#_display").on("change",function(){console.log(parseFloat($(this).val()))});$("body").on("keyup",function(a){switch(console.log(a.keyCode),a.keyCode){case 8:$(".delete").click();break;case 13:$(".equal").click();break;case 46:$(".clear").click();break;case 48:case 45:c.display("0","number");break;case 49:case 35:c.display("1","number");break;case 50:case 40:c.display("2","number");break;case 51:case 34:c.display("3","number");break;case 52:case 37:c.display("4","number");break;case 53:case 12:c.display("5","number");break;case 54:case 39:c.display("6","number");break;case 55:case 36:c.display("7","number");break;case 56:case 38:c.display("8","number");break;case 57:case 33:c.display("9","number");break;case 106:c.display("*","operator");break;case 107:c.display("+","operator");break;case 109:c.display("-","operator");break;case 191:case 111:c.display("/","operator");break;case 187:$(".equal").click()}}),$(".calculator-button").on("click",function(a){var e=Object.keys($(this).data())[0];c.display($(this).data(e),e)})});